import React from 'react'
import classes from './Cart.module.css';
import CartItem from './CartItem';

const Cart = () => {
  return (
    <div>
      <CartItem />
      <div className={classes.total}>Total Amount</div>
      <div className={classes.actions}>
        <button>Order</button>
      </div>
    </div>
  )
}

export default Cart
